    const userInfo = async () => {
        console.log("GAS");
        const web3 = new Web3(window.ethereum);
        const balance = await web3.eth.getBalance(accountAddress);

        return accountAddress;
    }

    return (
        <div>
            <h1>{accountAddress}</h1>
            <h3>{userInfo()}</h3>
        </div>
    );
}

export default WalletPage;
